detaileddescription.para:
The key exchange flow for J-PAKE is as follows:

To get the first round data that needs to be sent to the peer, call //Getg1
psa_pake_output(operation,#PSA_PAKE_STEP_KEY_SHARE,...);
//GettheZKPpublickeyforx1
psa_pake_output(operation,#PSA_PAKE_STEP_ZK_PUBLIC,...);
//GettheZKPproofforx1
psa_pake_output(operation,#PSA_PAKE_STEP_ZK_PROOF,...);
//Getg2
psa_pake_output(operation,#PSA_PAKE_STEP_KEY_SHARE,...);
//GettheZKPpublickeyforx2
psa_pake_output(operation,#PSA_PAKE_STEP_ZK_PUBLIC,...);
//GettheZKPproofforx2
psa_pake_output(operation,#PSA_PAKE_STEP_ZK_PROOF,...);


To provide the first round data received from the peer to the operation, call //Setg3
psa_pake_input(operation,#PSA_PAKE_STEP_KEY_SHARE,...);
//SettheZKPpublickeyforx3
psa_pake_input(operation,#PSA_PAKE_STEP_ZK_PUBLIC,...);
//SettheZKPproofforx3
psa_pake_input(operation,#PSA_PAKE_STEP_ZK_PROOF,...);
//Setg4
psa_pake_input(operation,#PSA_PAKE_STEP_KEY_SHARE,...);
//SettheZKPpublickeyforx4
psa_pake_input(operation,#PSA_PAKE_STEP_ZK_PUBLIC,...);
//SettheZKPproofforx4
psa_pake_input(operation,#PSA_PAKE_STEP_ZK_PROOF,...);


To get the second round data that needs to be sent to the peer, call //GetA
psa_pake_output(operation,#PSA_PAKE_STEP_KEY_SHARE,...);
//GetZKPpublickeyforx2*s
psa_pake_output(operation,#PSA_PAKE_STEP_ZK_PUBLIC,...);
//GetZKPproofforx2*s
psa_pake_output(operation,#PSA_PAKE_STEP_ZK_PROOF,...);


To provide the second round data received from the peer to the operation, call //SetB
psa_pake_input(operation,#PSA_PAKE_STEP_KEY_SHARE,...);
//SetZKPpublickeyforx4*s
psa_pake_input(operation,#PSA_PAKE_STEP_ZK_PUBLIC,...);
//SetZKPproofforx4*s
psa_pake_input(operation,#PSA_PAKE_STEP_ZK_PROOF,...);


To access the shared secret call //GetKa=Kb=K
psa_pake_get_implicit_key()

Before calling any function on a PAKE operation object, the application must initialize it by any of the following means:

Set the structure to all-bits-zero, for example: psa_pake_operation_toperation;
memset(&operation,0,sizeof(operation));


Initialize the structure to logical zero values, for example: psa_pake_operation_toperation={0};


Initialize the structure to the initializer PSA_PAKE_OPERATION_INIT, for example: psa_pake_operation_toperation=PSA_PAKE_OPERATION_INIT;


Assign the result of the function psa_pake_operation_init() to the structure, for example: psa_pake_operation_toperation;
operation=psa_pake_operation_init();

listitem.para:
For DSA keys (PSA_KEY_TYPE_DSA_PUBLIC_KEY or PSA_KEY_TYPE_DSA_KEY_PAIR), the Dss-Params format as defined by RFC 3279 2.3.2. Dss-Params::=SEQUENCE{
pINTEGER,
qINTEGER,
gINTEGER
}

For Diffie-Hellman key exchange keys (PSA_KEY_TYPE_DH_PUBLIC_KEY(PSA_DH_FAMILY_CUSTOM) or PSA_KEY_TYPE_DH_KEY_PAIR(PSA_DH_FAMILY_CUSTOM)), the DomainParameters format as defined by RFC 3279 2.3.3. DomainParameters::=SEQUENCE{
pINTEGER,--oddprime,p=jq+1
gINTEGER,--generator,g
qINTEGER,--factorofp-1
jINTEGEROPTIONAL,--subgroupfactor
validationParamsValidationParamsOPTIONAL
}
ValidationParams::=SEQUENCE{
seedBITSTRING,
pgenCounterINTEGER
}
